function VoyPanel() {
  return(
   <div>
      <img src={"../../static/VoyPhone.png"} alt="Phone with Voy App open"/>
      <div className="content" >
        <a><b>Venture-backed</b> audio tour application</a>
      </div>
      <style jsx>{`
        display: inline-block;
        img{
          padding-top: 10vh;
          float: left;
          padding-left: 10vw;
          height: 45vh;
        }
        .content{
          float: left;
          display: block;
          padding-top: 15vh;
          padding-left: 5vw;
        }
        a{
          font-size: 4.5vh;
        }
        p{
          padding-top: 2vh;
          display: block;
          word-break: break-word;
          font-size: 2.5vh;
        }

      `}</style>
    </div>
  )
}
export default VoyPanel
